            />
          </svg>
        </div>

        <v-row v-if="dummyData.length > 0 || search">
          <v-col cols="12" md="5">
            <h2>Teams</h2>
          </v-col>
          <v-col cols="12" md="7" class="d-flex align-center">
            <v-select
              flat
              solo
              background-color="var(--secondary-color)"
              class="radius-7 sorting mr-3 custom-select-small"
              append-icon="mdi-chevron-down"
              hide-details
              v-model="sorting.sortDirection"
              :items="['Ascending', 'Descending']"
            >
            </v-select>
            <v-text-field
              solo
              flat
              background-color="var(--secondary-color)"
              class="radius-7"
              hide-details
              v-model="search"
              @input="fetchdata"
              placeholder="Search team"
            >
              <template v-slot:prepend-inner>
                <v-img src="/images/search.svg" class="px-3" contain></v-img>
              </template>
            </v-text-field>
          </v-col>
        </v-row>

        <div
          class="add-icon"
          v-if="getRolePermissions == 'own' || getRolePermissions == 'admin'"
        >
          <v-icon @click="addDialog = true">mdi-plus-circle</v-icon>
        </div>

        <v-row
          class="mt-5"
          justify-xs="center"
          justify-sm="start"
          v-if="dummyData.length > 0"
        >
          <v-col
            v-for="(value, index) in dummyData"
            :key="index"
            cols="12"
            sm="6"
            md="4"
            lg="3"
            class="position-relative"
          >
            <div class="dots-menu">
              <v-menu
                left
                offset-y
                max-width="150"
                v-if="
                  getRolePermissions == 'own' || getRolePermissions == 'admin'
                "
              >
                <template v-slot:activator="{ on, attrs }">
                  <v-icon
                    color="var(--primary-color)"
                    v-bind="attrs"
                    v-on="on"
                    style="font-size: 30px"
                    >mdi-dots-horizontal-circle</v-icon
                  >
                </template>
                <v-list class="py-0">
                  <v-list-item class="px-2">
                    <v-list-item-title
                      class="aliceblue--text text-start font-weight-600 cursor-pointer"
                      @click="editItem(value)"
                    >
                      <div class="d-flex align-center">
                        <v-icon
                          class="pr-2"
                          style="font-size: 20px; color: var(--primary-color)"
                          >mdi-square-edit-outline</v-icon
                        >
                        <span style="color: var(--primary-color)">Edit</span>
                      </div>
                    </v-list-item-title>
                  </v-list-item>
                  <v-list-item class="px-2">
                    <v-list-item-title
                      class="aliceblue--text text-start font-weight-600 cursor-pointer"
                      @click="deleteDialogId(value)"
                    >
                      <div class="d-flex align-center">
                        <v-icon
                          class="pr-2"
                          style="font-size: 20px; color: var(--primary-color)"
                          >mdi-delete-outline</v-icon
                        >
                        <span style="color: var(--primary-color)">Delete</span>
                      </div>
                    </v-list-item-title>
                  </v-list-item>
                </v-list>
              </v-menu>
            </div>
            <router-link
              :to="`/team/teamprofile?teamId=${value.id}`"
              class="text-decoration-none"
            >
              <v-card
                width="350"
                color="var(--secondary-color)"
                class="pb-3 px-5 mb-1 radius-21 cursor-pointer"
                flat
                height="241"
              >
                <div
                  class="d-flex flex-column justify-center align-center position-relative"
                >
                  <h5
                    class="cyan-text mt-5 text-center handler-text-overflow mb-3 px-3"
                    style="line-height: 1"
                  >
                    {{ value.teamName }}
                  </h5>
                  <div class="card-image">
                    <v-avatar size="100%" v-if="value.teamLogo">
                      <v-img :src="`${imageURL}${value.teamLogo}`"></v-img>
                    </v-avatar>
                    <v-avatar v-else>
                      <v-img
                        src="/images/groupuser.png"
                      ></v-img>
                    </v-avatar>
                  </div>
                </div>
                <h6 class="text-center font-weight-600 cyan-text mt-2">
                  {{ value.teamCount }}
                  <span class="cyan-text">Members</span>
                </h6>
              </v-card>
            </router-link>
          </v-col>
        </v-row>
      </div>

      <div
        class="d-flex justify-space-between align-center pb-14 mt-7"
        v-if="dummyData.length > 0"
      >
        <div>
          <span class="font-14" style="color: var(--primary-color) !important"
            >Showing 1-{{ pagination.footerValue }} of
            {{ pagination.totalCount }} entries</span
          >
        </div>
        <div class="d-flex align-center">
          <span
            class="font-14 mr-5"
            style="color: var(--primary-color) !important"
            >Entries per page:</span
          >
          <v-select
            v-model="pagination.footerValue"
            :items="[8, 16, 32, 64]"
            dense
            class="footer-select"
            hide-details
          >
          </v-select>
          <v-pagination
            v-model="pagination.page"
            :length="pagination.totalPages"
            color="var(--primary-color)"
            @input="fetchdata"
            :total-visible="7"
          ></v-pagination>
        </div>
      </div>
      <div
        class="default-view font-28 font-weight-600"
        style="color: var(--primary-color)"
        v-if="dummyData.length === 0 && search"
      >
        No Records Found
      </div>
    </div>

    <v-dialog v-model="addDialog" persistent max-width="500">
      <v-card class="pa-6 radius-21">
        <addcomponent @close="close" @fetchList="fetchdata" />
      </v-card>
    </v-dialog>
    <v-dialog v-model="editDialog" persistent max-width="500">
      <v-card class="pa-6 radius-21">
        <editcomponent @close="close" :editId="editId" @fetchList="fetchdata" />
      </v-card>
    </v-dialog>
    <v-dialog v-model="deleteDialog" persistent max-width="400">
      <v-card class="pa-6 radius-21">
        <div class="d-flex justify-end">
          <v-icon
            @click="deleteDialog = false"
            color="var(--primary-color)"
            style="font-size: 33px"
            >mdi-close-circle</v-icon
          >
        </div>
        <div class="d-flex justify-center">
          <deletesvgcomponent />
        </div>
        <h3
          class="font-weight-500 text-center"
          style="color: var(--primary-color)"
        >
          Are you sure?
        </h3>
        <h6
          class="text-center font-weight-500"
          style="color: var(--primary-color)"
        >
          Delete this team
        </h6>
        <v-row class="mt-4 mb-1">
          <v-col cols="12" md="6">
            <v-btn
              class="py-6 w-100 radius-25"
              color="var(--primary-color)"
              @click="close()"
              ><span class="text-transform font-18 white--text">Cancel</span>
            </v-btn>
          </v-col>
          <v-col cols="12" md="6">
            <v-btn
              class="py-6 w-100 radius-25"
              color="var(--primary-color)"
              @click="deleteTeam()"
              ><span class="text-transform font-18 white--text">Delete</span>
            </v-btn>
          </v-col>
        </v-row>
      </v-card>
    </v-dialog>
  </div>
</template>

<script>
import addcomponent from "@/components/Teams/add.component.vue";
import editcomponent from "@/components/Teams/edit.component.vue";
import deletesvgcomponent from "@/components/Deletesvg/delete.component.vue";
import { mapGetters } from "vuex";
export default {
  components: { addcomponent, editcomponent, deletesvgcomponent },
  data() {
    return {
      loader: false,
      addDialog: false,
      imageURL: process.env.VUE_APP_IMG_API,
      deleteDialog: false,
      editDialog: false,
      pagination: {
        page: 1,
        footerValue: 8,
        totalPages: null,
        totalCount: null,
      },
      sorting: {
        sortBy: "TeamName",
        sortDirection: "Ascending",
      },
      dummyData: [],
      deleteId: "",
      editId: "",
      payload: {},
      search: null,
    };
  },
  computed: {
    ...mapGetters([
      "getTeamsListByBroker",
      "getUserId",
      "getOrganizationId",
      "getRolePermissions",
    ]),
  },
  watch: {
    getOrganizationId: {
      immediate: true,
      handler(newValue, oldValue) {
        if (oldValue && oldValue !== newValue) {
          this.fetchdata();
          this.close();
        }
      },
    },
    "pagination.footerValue": {
      immediate: true,
      handler(newValue, oldValue) {
        if (this.dummyData.length > 0) {
          if (newValue !== oldValue && this.pagination.page > 1) {
            this.pagination.page = 1;
          }
          this.fetchdata();
        }
      },
    },
    "sorting.sortDirection": {
      immediate: true,
      handler(newValue, oldValue) {
        if (this.dummyData.length > 0 && newValue !== oldValue)
          this.fetchdata();
      },
    },
  },
  methods: {
    editItem(value) {
      this.editDialog = true;
      this.editId = value.id;
    },
    deleteDialogId(value) {
      this.deleteId = value.id;
      this.deleteDialog = true;
    },
    fetchdata() {
      const Id = this.getUserId;
      if (Id) {
        this.payload = {
          orgId: this.getOrganizationId,
          isPagination: true,
          size: this.pagination.footerValue,
          pageNo: this.pagination.page,
          sortBy: this.sorting.sortBy,
          sortDirection:
            this.sorting.sortDirection === "Ascending" ? "ASC" : "DESC",
        };
        if (this.search) {
          this.payload = {
            search: this.search.trim(),
            orgId: this.getOrganizationId,
            isPagination: false,
            sortBy: this.sorting.sortBy,
            sortDirection:
              this.sorting.sortDirection === "Ascending" ? "ASC" : "DESC",
          };
          if (this.pagination.page > 1) {
            this.pagination.page = 1;
          }
        }
        this.loader = true;
        this.$store
          .dispatch("getTeamsListByBroker", this.payload)
          .then((response) => {
            this.loader = false;
            this.dummyData =
              response.data.data.teamList || response.data.data.teamData; // one for search and one for overall data
            if (this.dummyData.length === 0 && this.pagination.page > 1) {
              this.pagination.page = 1;
              this.fetchdata();
            }
            this.pagination.totalCount = response.data.totalCounts;
            this.pagination.totalPages = this.search
              ? 1
              : Math.ceil(
                  this.pagination.totalCount / this.pagination.footerValue
                );
          });
      }
    },
    close() {
      this.addDialog = false;
      this.editDialog = false;
      this.deleteDialog = false;
    },
    deleteTeam() {
      this.loader = true;
      this.$store.dispatch("deleteTeam", this.deleteId).then((response) => {
        if (response.data.succeeded === true) {
          this.loader = false;
          this.$swal.fire({
            position: "top-end",
            icon: "success",
            title: "Team deleted successfully",
            showConfirmButton: false,
            timer: 2000,
            toast: true,
          });
          this.close();
          this.fetchdata();
        } else {
          this.loader = false;
          this.$swal.fire({
            position: "top-end",
            icon: "error",
            title: response.data.message,
            showConfirmButton: false,
            timer: 2000,
            toast: true,
          });
        }
      });
    },
  },
  mounted() {
    this.fetchdata();
  },
};
</script>

